import React from "react";
import { Link } from "react-router-dom"

export default function NavBarLinksTwo(props) {
    return (
        <div className="dropdown">
            <div className="dropbtn">
                {props.name}
                <svg width="1em" height="1em" viewBox="0 0 16 16" class="bi bi-caret-down" fill="currentColor" xmlns="http://www.w3.org/2000/svg">
                    <path fill-rule="evenodd" d="M3.204 5L8 10.481 12.796 5H3.204zm-.753.659l4.796 5.48a1 1 0 0 0 1.506 0l4.796-5.48c.566-.647.106-1.659-.753-1.659H3.204a1 1 0 0 0-.753 1.659z" />
                </svg>
            </div>
            <Link to="/sources">
                <div className="dropdown-content" onClick={props.onClick}>



                    <p>{props.link3}</p>
                    <p>{props.link4}</p>
                    <p>{props.link5}</p>
                    <p>{props.link6}</p>
                    <p>{props.link7}</p>

                </div>
            </Link>
        </div>
    );
}
